import './App.css';
import bg from "./assets/bg-web.png"
import logo from "./assets/logo.png"

function App() {

  const styles = {
    container: {backgroundImage: bg, backgroundSize: "cover", minHeight: "100vh" },
    title: {
      color: "#FFF"
    }
  }

  return (
    <div className="App" style={{backgroundImage: bg, backgroundSize: "cover", minHeight: "100vh" }}>
      <div className="header" style={{display: 'flex', flexDirection: "row", alignItems: "center"}}>
        <div className="title" style={{display: 'flex', flexDirection: "row", alignItems: "flex-end"}}>
          <h1 style={styles.title}>FlyFair</h1>
        </div>
        <img src={logo} height={100}/>
      </div>
    </div>
  );
}

export default App;
